import React from 'react';
import Button from '@material-ui/core/Button';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core/styles'

const styles = {
    'width': '80%',
}

const BatchPanel = () => {
    return(
        <Container>
            <div className="batch-panel-description"></div>
            <form action="" className="batch-panel__form">
                <label className="batch-panel__label__number-of-rows">
                    Number of Rows to be Inserted into Database
                </label>
                <input type="text"/>
                <Button 
                    variant="contained" 
                    size="medium" 
                    color="primary"
                >
                    Primary
                </Button>
            </form>
        </Container>
    )
}

export default BatchPanel;
